column1:
Op de tijdlijn van Linda Duin lees ik het volgende;

Mijn kleindochter had gisteren een wedstrijd teakwondo. Dus Vrijdagavond een test gedaan. Maar ik heb een héél oplettende zoon. Hij ziet een groen zakje en een rood zakje met testen. Hij in gesprek met die lui. Iemand heeft hem mee naar buiten genomen. En mijn zoon steeds maar doorvragen. Ze hebben toe gegeven dat in het rode zakje met testen staafjes besmet zijn met het virus en de groene niet. Dit is dus om de cijfers hoog te houden en zoveel mogelijk mensen en kinderen te vaccineren. Ik ben woest!! 😡😡
Dit is gepost door Annie Westerhof.

Natasia In Tune reageert hier op met;  
Dit heb ik vorig jaar al geschreven toen ik bij de GGD werkte , ik ben ook gestopt nadat wij opdracht kregen (door RIVM) iedereen die gemeld stond als contact gehad met ...op positief te moeten zetten!

Let op: na het plaatsen van dit bericht is duidelijk geworden dat een rood en groen zakje standaard bij een test zitten. Dit ter controle van de uislag van de test.
